import React, { Component } from "react";
import TableRow from "./../TableRow/TableRow";
import axios from "axios";

class Table extends Component {
  constructor() {
    super();
    this.state = { products: [] };
  }

  componentDidMount() {
    axios
      .get(this.props.url)
      .then(response => {
        this.setState({ products: response.data });
        console.log("Table: " + this.props.url);
      })
      .catch(error => {
        console.log(error);
      });
  }

  render() {
    axios
      .get(this.props.url)
      .then(response => {
        this.setState({ products: response.data });
        console.log("Table: " + this.props.url);
      })
      .catch(error => {
        console.log(error);
      });
    const tableRows = this.state.products.map(item => {
      console.log(item);
      return <TableRow id={item.id} image={item.image} title={item.title} />;
    });
    return (
      <div className="container">
        <table className=" text-center table table-striped table-dark">
          <thead>
            <tr>
              <th scope="col">ID</th>
              <th scope="col">Image</th>
              <th scope="col">Title</th>
              <th scope="col">{""}</th>
            </tr>
          </thead>
          <tbody>{tableRows}</tbody>
        </table>
      </div>
    );
  }
}

export default Table;
